import React from 'react';
import Tiza from './TizaLinoPrego.png';


const LinoParis = (props) => {

    const color = (nombre) =>{
        let color={
            'Tiza': Tiza,
            // 'Aluminio': Aluminio,
            // 'Stone': Stone,
            // 'Ceniza': Ceniza,
            // 'Grafito': Grafito,
            // 'Carbón': Carbón,
            // 'Negro': Negro,
            // 'Natural': Natural,
            // 'Niebla': Niebla,
            // 'Nougat': Nougat,
            // 'Madera': Madera,
            // 'Lila': Lila,
            // 'Pink': Pink,
            // 'Limón': Limón,
            // 'Agua': Agua,
            // 'Turquesa': Turquesa,
            // 'Blue': Blue,
            // 'Azul Lavado': AzulLavado,
            // 'Denim': Denim,
            // 'Marino': Marino,
            // 'Pimenton': Pimenton,
            // 'Lacre': Lacre,
            // 'Guinda': Guinda, 
            // 'Ginger': Ginger, 
            // 'Café': Café, 
            // 'Arena': Arena
        }
        console.log(color[nombre])
        return color[nombre];
    }

    return <img href={color(props.color)} x="0" y="0" width="100" height="100" alt="background"/>
}

export default LinoParis;
